script: |
  super -f text -I q1985.spq | sort > q1985.out

inputs:
  - name: q1985.spq
    data: |
      SELECT DISTINCT ( col0 ) * ( - ( - col1 ) ) + ( + col1 + - tab2.col1 ) * col2 * tab2.col1 FROM tab2 (FORMAT parquet);
  - name: tab2

outputs:
  - name: q1985.out
    data: |
      1343
      217
      4602
